import "./App.css";

function App() {
  return (
    <article>
      <time>30 Aug 2021</time>
      <time datetime="2021-08-30">30 Aug,2021</time>
      <time datetime="2021-08-30">30 Aug</time>
      <time datetime="2021-08-30">2 days ago</time>
      <time datetime="2021-08-30">tomorrow</time>
    </article>
  );
}

export default App;
